import React from "react";
import Header from "../components/Header";

const Home: React.FC = () => {
  return (
    <div>
      <Header />
      <main>
        <h1>Bem-vindo à roque LABS</h1>
        <p>
          roque LABS é uma empresa de tecnologia focada em desenvolver soluções
          inteligentes por meio de aplicativos, sistemas web e automações
          personalizadas.
        </p>
      </main>
    </div>
  );
};

export default Home;
